महोदय;  

सविनय निवेदन है कि मैं योगेश गौतम; निवासी मधुवन महोली मथुरा।  वार्ड संख्या 59  का निवासी हूँ।  हमारे क्षेत्र ( *पोस्ट ऑफिस वाली गली चढ़ाई पर* ) 6 माह के लंबे समय से जल सुविधा  नहीं दी जा रही है जिसके चलते पानी की समस्या बनी हुई है इस समस्या के कारण स्थानीय निवासियों को अत्यधिक अ

आदरणीय नगर आयुक्त महोदय;

सविनय निवेदन है कि हमारी कॉलोनी राधा कृष्ण वाटिका; जैसिंहपुरा; मथुरा में कई घरों व फैक्ट्रियों के सीवरेज कनेक्शन न होने के कारण प्लॉटों में गंदा पानी जमा रहता है। इससे दुर्गंध; मच्छर; मलेरिया व डेंगू जैसी बीमारियाँ फैल रही हैं और आमजन को भारी परेशानी हो रही है।

कृपया शीघ्र निरीक्षण कराकर सभी घरों व फैक्ट्रियों के सीवरेज कनेक्शन उचित रूप से जोड़े जाएँ तथा जमा पानी की सफाई

